&quot;The property, a 42-acre estate, now designated a national historic site, was once home to the elegant Candler Mansion and greenhouses built in 1920 by Asa Candler Jr., son of the Coca-Cola founder. If you close your eyes, you can almost imagine the zoo animals that once roamed the property and eventually became the first occupants of Atlanta’s zoo—an elephant parading by the swimming pool perhaps, a giraffe peering over the long stone wall on Briarcliff Road. In the evening, partygoers frequently danced the night away in the third-floor ballroom.

In 1948, the Candlers sold the estate to the General Services Administration for use as a veterans hospital, which never materialized. Instead, the Georgian Clinic (later known as the DeKalb County Addiction Center) opened there as the first alcohol treatment facility in the state. Emory helped the state develop the Georgia Mental Health Institute in the mid-1960s.&quot;

From <a href="http://emoryhistory.emory.edu/places/campuses/CampusBriarcliff.html" rel="noreferrer nofollow">Emory History</a>

